import React from 'react';
import s from './Dialogs.module.css';
const Dialogs = () => {
    return (
        <div className={s.dialogs}>
            <div className={s.dialogsItems}>
                <div className={s.dialogItem + ' ' + s.active}>Dimych</div>
                <div className={s.dialogItem}>Andrey</div>
                <div className={s.dialogItem}>Sveta</div>
                <div className={s.dialogItem}>Viktor</div>
                <div className={s.dialogItem}>Valera</div>
                <div className={s.dialogItem}>Sasha</div>
            </div>
            <div className={s.messages}>
                <div className={s.message}>Hi</div>
                <div className={s.message}>How is your day?</div>
                <div className={s.message}>Yo</div>
            </div>
        </div>
    );
};

export default Dialogs;
